def isValid(s):
    if len(s) == 0:
        return True
    if len(s) % 2 != 0:
        return False

    inArray = []
    outArray = []

    ins = ["(", "[", "{"]
    outs = [")", "]", "}"]

    if s[0] in outs:
        return False

    for i in s:
        if i is "(" or i is "[" or i is "{":
            inArray.append(i)
        else:
            outArray.append(i)

    if (len(inArray) != len(outArray)):
        return False

    lens = len(inArray)
    lastIn = []

    for k in range(len(s)):
        if s[k] in outs:
            if lastIn[len(lastIn) - 1] is "(" and s[k] is not ")":
                return False
            elif lastIn[len(lastIn) - 1] is "[" and s[k] is not "]":
                return False
            elif lastIn[len(lastIn) - 1] is "{" and s[k] is not "}":
                return False
            elif len(lastIn) is not 0:
                lastIn.pop()
            else:
                return False

        if s[k] in ins:
            lastIn.append(s[k])

    return True

